In case you check our projects you will find that we are making extensive use of child allocators. This allows us to log the use of their memory in our Memory Usage Tab . In case you check our Write a custom Tab example you will find in its create function this code: static tm_tab_i* tab__create(tm_tab_create_context_t* context, tm_ui_o *ui)
{ tm_allocator_i allocator = tm_allocator_api->create_child(context->allocator, "my tab"); uint64_t* id = context->id; static tm_the_machinery_tab_vt* vt = 0; if (!vt) vt = tm_global_api_registry->get(TM_CUSTOM_TAB_VT_NAME); tm_tab_o* tab = tm_alloc(&allocator, sizeof(tm_tab_o)); *tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt*)vt, .inst = (tm_tab_o*)tab, .root_id = *id, }, .allocator = allocator, }; return &tab->tm_tab_i;
} static void tab__destroy(tm_tab_o* tab)
{ tm_allocator_i a = tab->allocator; tm_free(&a, tab, sizeof(*tab)); tm_allocator_api->destroy_child(&a);
} The tm_tab_create_context_t context gives you access to the system allocator. This one again allows you to create a child allocator. We can now use the new allocator in our tab. This is why we store it within our tm_tab_o object. In the end, we need to destroy our tab and, therefore free the tab object and destroy the child allocator. tm_allocator_api->destroy_child(&a); If we now shut down the engine and we forgot to free any of the allocations done between create and destroy, we will get a nice log: D:\git\themachinery\plugins\my_tab\my_tab.c(100): error leaked 1 allocations 4112 bytes
