A Truth-Type in The Machinery consists out of a name (its identifier) and properties. Note: In theory, you could also define a Type without properties. To add a Type to the system, you need access to the Truth instance. The Engine may have more than one instance of a Truth. Example: There is a Project Truth to keep all the project-related settings and an Engine/Application Truth that holds all the application-wide settings. Generally speaking, you want to define Truth Types at the beginning of the Engine's life cycle. Therefore the designated place is the tm_load_plugin function. The Truth has an interface to register a truth type creation function: tm_the_truth_create_types_i . This interface expects a function of the signature: void create_truth_types(tm_the_truth_o *tt). Whenever the Engine creates a Truth, it invokes this interface on all loaded plugins, and their types are registered. You do not need to register your Type to the interface if you want to register your Type to a specific Truth. Note: Mostly this function is called: create_truth_types Let us define a type. To do that, we need to get the tm_truth_api first: // beginning of the source file
static struct tm_the_truth_api *tm_the_truth_api;
#include <foundation/api_registry.h>
// include
// [macros.h](https://ourmachinery.com/apidoc/foundation/macros.h.html#macros.h)
// to access TM_ARRAY_COUNT for convinace:
#include <foundation/macros.h>
#include <foundation/the_truth.h>
// ... other code
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load) { tm_the_truth_api = tm_get_api(reg, tm_the_truth_api);
} After this, we define our type name once as a constant char define and one hashed version. There are some conventions to keep in mind: The plain text define should start with: TM_TT_TYPE__. The hashed define should start with: TM_TT_TYPE_HASH__ The name may or may not start with tm_ but the name plain text and the hashed version need to match! #pragma once
#include <foundation/api_types.h> #define TM_TT_TYPE__MY_TYPE "tm_my_type"
#define TM_TT_TYPE_HASH__MY_TYPE TM_STATIC_HASH("tm_my_type", 0xde0e763ccd72b89aULL) Tip: Do not forget to run hash.exe. Otherwise, the TM_STATIC_HASH macro will cause an error. You can also run tmbuild --gen-hash It is good practice to place the types into a header file so others can use these types as well! When that is done we can call the tm_the_truth_api->create_object_type() to create the actual type. It will return a tm_tt_type_t which is the identifier of our type. The tm_tt_id_t will also refer to the type here! The function expects: Argument Description tm_the_truth_o *tt The Truth instance. This function will add the type to this instance const char *name The name of the type. It will be hashed internally. Therefore the hash value of TM_TT_TYPE__ and TM_TT_TYPE_HASH___ should match! If a type with name already exists, that type is returned. Different types with the same name are not supported! const tm_the_truth_property_definition_t *properties The definitions of the properties of the type. uint32_t num_properties The number of properties. Should match properties The home of this function should be our void create_truth_types(tm_the_truth_o *tt) . We need to add this one to our source file. After this we add the call to create_object_type to it. Remember that we have no properties yet, and our call would look like this: static void create_truth_types(tm_the_truth_o *tt) { tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_TYPE, 0, 0);
} The last step is to tell the plugin system that we intend to register our register_truth_type(). TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load) { tm_the_truth_api = tm_get_api(reg, tm_the_truth_api); tm_add_or_remove_implementation(reg, load, tm_the_truth_create_types_i, create_truth_types);
} The full source code should look like this: my_type.h #pragma once
#include <foundation/api_types.h> #define TM_TT_TYPE__MY_TYPE "tm_my_type"
#define TM_TT_TYPE_HASH__MY_TYPE TM_STATIC_HASH("tm_my_type", 0xde0e763ccd72b89aULL) (Tip: Do not forget to run hash.exe) my_type.c // beginning of the source file
static struct tm_the_truth_api *tm_the_truth_api;
#include <foundation/api_registry.h>
#include <foundation/the_truth.h>
#include "my_type.h"
static void create_truth_types(tm_the_truth_o *tt)
{ tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_TYPE, 0, 0);
}
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_the_truth_api = tm_get_api(reg, tm_the_truth_api); tm_add_or_remove_implementation(reg, load, tm_the_truth_create_types_i, create_truth_types);
} After all of this you have registered your type and it could be used. This type is just not really useful without properties.

