The Machinery is organized into individual APIs that can be called to perform specific tasks. A plugin is a DLL that exposes one or several of these APIs. In order to implement its functionality, the plugin may in turn rely on APIs exposed by other plugins. A central object called the API registry is used to keep track of all the APIs. When you want to use an API from another plugin, you ask the API registry for it. Similarly, you expose your APIs to the world by registering them with the API registry. This may seem a bit abstract at this point, so lets look at a concrete example, unicode.h which exposes an API for encoding and decoding Unicode strings: {{$include {TM_SDK_DIR}/foundation/unicode.h:0:97}} Lets go through this. First, the code includes <api_types.h>. This is a shared header with common type declarations, it includes things like <stdbool.h> and <stdint.h> and also defines a few The Machinery specific types, such as tm_vec3_t . In The Machinery we have a rule that header files can't include other header files (except for <api_types.h>). This helps keep compile times down, but it also simplifies the structure of the code. When you read a header file you dont have to follow a long chain of other header files to understand what is happening. Next follows a block of forward struct declarations (in this case only one). Next, we have the name of this API defined as a constant tm_unicode_api , followed by the struct tm_unicode_api that defines the functions in the API. To use this API, you would first use the API registry to query for the API pointer, then using that pointer, call the functions of the API: static struct tm_unicode_api *tm_unicode_api;
#include <foundation/api_registry.h>
#include <foundation/unicode.h> static void demo_usage(char *utf8, uint32_t codepoint)
{ tm_unicode_api->utf8_encode(utf8, codepoint); //more code...
} TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_unicode_api = tm_get_api(reg, tm_unicode_api);
} The different APIs that you can query for and use are documented in their respective header files, and in the apidoc.md.html documentation file (which is just extracted from the headers). Consult these files for information on how to use the various APIs that are available in The Machinery. In addition to APIs defined in header files, The Machinery also contains some header files with inline functions that you can include directly into your implementation files. For example <math.inl> provides common mathematical operations on vectors and matrices, while <carray.inl> provides a stretchy-buffer implementation (i.e. a C version of C++s std::vector).

