function: [[ output.res = x * x * x;
]] creation_graph_node: { name: "tm_cube_node" display_name: "Cube" category: "Shader/Math" inputs: [ { name: "x" display_name: "X" } ] outputs: [ { name: "res" display_name: "Result" type: { type_of: "x" } } ]
} This node shows you the absolute basics of making a creation graph GPU node. All GPU nodes require two blocks. The function block is where you put the actual shader code. The creation_graph_node is a meta node that defines node I/O and general information. In this example, the creation_graph_node has several fields, but more can be defined: name must be a unique identifier for the node. Its a good idea to prefix this with your namespace to make sure it doesn't inadvertently collide with nodes created by other people. display_name is optional and specifies node name to show in the UI. If this is empty, a display name will be generated from the name field. category is an optional path-type string that allows you to group related nodes. inputs is an array of input parameters for the node. A type can be specified for each parameter but it is not required. If you don't specify a type, the type will be generic. outputs is an array of output values for the node. Note that we didnt specify a type parameter for our input field. This makes it a fuzzy input and anything that supports the multiplication operator can be passed. Our output parameter does have a type field, but instead of defining a fixed type, it uses a generic syntax that sets the output type to whatever the input type was. For more information about this syntax see the Shader System Reference .

