Output nodes are more complex than function nodes. Instead of a single function block, these nodes take the form of a render pass that can have variations based on the systems used with it and the connected inputs. The example above creates a very simple material node that displays a gray-scale interpretation of the objects distance to the viewing camera. depth_stencil_states: { depth_test_enable: true depth_write_enable: true depth_compare_op: "greater_equal"
} raster_states: { front_face: "ccw"
} imports: [ { name: "tm" type: "float4x4" }
] vertex_shader: { import_system_semantics: [ "vertex_id" ] code: [[ tm_vertex_loader_context ctx; init_vertex_loader_context(ctx); float4 vp = load_position(ctx, vertex_id, 0); float4 wp = mul(vp, load_tm()); output.position = mul(wp, load_camera_view_projection()); return output; ]]
} pixel_shader: { code: [[ float2 near_far = load_camera_near_far(); float depth = linearize_depth(input.position.z, near_far.x, near_far.y) * 0.01f; output.buffer0 = float4(linear_to_gamma2(depth), 1); // Base color, alpha output.buffer1 = float4(1, 1, 0, 1); // Normal (encoded in signed oct) output.buffer2 = float4(0, 0, 0, 1); // Specular, Roughness output.velocity = float2(0, 0); return output; ]]
} The creation_graph_node block for this node is very small. If no outputs are specified, the output will be a Shader Instance. These can be passed to other nodes for rendering, like the Draw Call and Shader Instance output nodes. creation_graph_node: { name: "depth_output" display_name: "Depth" category: "Shader/Output"
} In this example the compile block has the following fields: includes specifies which common shaders this shader is dependent on. In this example, that is the common.tmsl shader because we use the linear_to_gamma2() function from that shader. contexts specifies how this pass should be executed depending on the context. In this example, we only support one context, the viewport. In this context, we want to run during the gbuffer phase so we specify that as our layer. We also want to enable the gbuffer_system as we will be writing to it. Finally we specify that in this context we will enable the gbuffer configuration. configurations are groups of settings. In this example we have one configuration group: gbuffer. This configuration requests three systems, if these systems are not present then we cannot run: The viewer_system is needed to query the camera information. The gbuffer_system allows us to render to the G-Buffer in the opaque pass of the default render pipeline. The vertex_buffer_system allows us to query vertex information from the mesh. compile: { includes: [ "common" ] configurations: { gbuffer: [{ variations: [{ systems: [ "viewer_system", "gbuffer_system", "vertex_buffer_system" ] }] }] } contexts: { viewport: [ { layer: "gbuffer" enable_systems: [ "gbuffer_system" ] configuration: "gbuffer" } ] }
} Note that the available contexts are defined by the application. Some examples of these in The Machinery editor are viewport, shadow_caster and ray_trace_material. Note that the layers are defined by the render pipeline used. Some examples from the default render pipeline are: gbuffer, skydome, hdr-transparency, ui.

