In this tutorial we will create a simple CPU node for the Creation Graph . The definition for these nodes is based on the Entity Graph Nodes, so there is some overlap. For this example we will create a node that generates a random uint32_t node with a settable maximum. To learn the difference between CPU and GPU nodes, check out Node Types . Lets first create the code for this node. This function will be called by the creation graph every time it needs to evaluate the node. Our only input to this function is the context of the creation graph. The first thing we will do is read our input from the context. We can query wires from the tm_creation_graph_interpreter_api using the read_wire() function. If this wire is not connected (or set directly) we early out with an error. After this, we start writing to our output wire. Note that this uses a very similar syntax, expect that we write to a pre-allocated pointer. Note that the indices of these wires is relative to the way they are defined. Our input wire is defined first so its index is 0. The output wire is defined second so it gets the index 1. static void random_node__run(tm_creation_graph_interpreter_context_t *ctx) { tm_creation_graph_interpreter_wire_content_t max_wire = tm_creation_graph_interpreter_api->read_wire(ctx->instance, ctx->wires[0]); if (!TM_ASSERT(max_wire.n, "Max wire was not connected to random node!")) return; uint32_t *res = (uint32_t *)tm_creation_graph_interpreter_api->write_wire( ctx->instance, ctx->wires[1], TM_TT_TYPE_HASH__UINT32_T, 1, sizeof(uint32_t)); *res = tm_random_to_uint32_t(tm_random_api->next()) % *(uint32_t *)max_wire.data;
} We need to register this node to the creation graph API. This is done through the creation graph node interface. We define the general information to the node like its name, display_name and I/O connectors (wires), and the actual function to run: static tm_creation_graph_node_type_i random_node = { .name = "tm_random", .display_name = "Random Uint", .static_connectors.in = { {.name = "max", .display_name = "Max", .type_hash = TM_TT_TYPE_HASH__UINT32_T}, }, .static_connectors.num_in = 1, .static_connectors.out = { {.name = "res", .display_name = "Result", .type_hash = TM_TT_TYPE_HASH__UINT32_T}, }, .static_connectors.num_out = 1, .run = random_node__run,
};
