vbuf_data[2] = (tm_triangle_vertex_t){.pos = (tm_vec3_t){1.0f, -1.0f, 0.0f}, .normal = (tm_vec3_t){0.0f, 0.0f, 1.0f}, .color = (tm_vec3_t){0.0f, 1.0f, 0.0f}};
