In The Machinery, all data is represented in The Truth. To add a new kind of data, we need to register a new Truth Type. Note that not all Truth types are Asset types. An Asset type is a Truth type that can exist as an independent object in the Asset Browser. For example, Vector3 is a Truth type representing an (x, y, z) vector, but it is not an asset type, because we can't create a Vector3 asset in the Asset Browser. A Vector3 is always a subobject of some other asset (such as an Entity). A Truth type is defined by a name (which must be unique) and a list of properties. Properties are identified by their indices and each property has a specific type. Typically, we put the type name, the hashed name and the list of properties in the header file, so that they can be accessed by other parts of the code. (Though if you have a Truth type that will only be used internally, in your own code, you could put it in the .c file.) Example header file my_asset.h: #pragma once
#include <foundation/api_types.h>
//... more code
#define TM_TT_TYPE__MY_ASSET "tm_my_asset"
#define TM_TT_TYPE_HASH__MY_ASSET TM_STATIC_HASH("tm_my_asset", 0x1e12ba1f91b99960ULL) Do not forget to run hash.exe whenever you use TM_STATIC_HASH() in your code. This will ensure that the correct value for the hash is cached in the macro. If you are creating a complicated type it may have subobjects that themselves have custom types. To make The Truth aware of this custom type we must register it with The Truth. This is done with a callback function that is typically called create_truth_types()or truth__create_types(),but the name doesn't really matter. We register this callback function under the tm_the_truth_create_types_i interface. That way, The Truth will now to call this function to register all the types whenever a new Truth object is created (this happens for example when you open a project using File Open ). Note: Interfaces and APIs are the main mechanisms for extending The Machinery. The difference is that an API only has a single implementation (there is only one tm_the_truth_api for instance), whereas there can be many implementations of an interface. Each plugin that creates new truth type will implement the tm_the_truth_create_types_i interface. Example tm_load_plugin function for my_asset.c: // -- load plugin
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load) { tm_the_truth_api = tm_get_api(reg, tm_the_truth_api); tm_add_or_remove_implementation(reg, load, tm_the_truth_create_types_i, create_truth_types); tm_add_or_remove_implementation(reg, load, tm_asset_browser_create_asset_i, &asset_browser_create_my_asset);
} Now we can implement the actual create_truth_types()function. We use tm_the_truth_api->create_object_type()to create a Truth type with a specified name and properties. At this point, we have a newThe Truth type. But it's not yet an asset! What Is the Difference between a Truth Type and an Asset? An Asset in The Machinery is just a Truth object of the type TM_TT_TYPE__ASSET . It looks like this: enum { // Name of the asset. TM_TT_PROP__ASSET__NAME, // string // Directory where the asset resides. For top-level assets, this is `NULL`. TM_TT_PROP__ASSET__DIRECTORY, // reference [[TM_TT_TYPE__ASSET_DIRECTORY]] // Labels applied to this asset. TM_TT_PROP__ASSET__UUID_LABELS, // subobject_set(UINT64_T) storing the UUID of the associated label. // Subobject with the actual data of the asset. The type of this subobject depends on the type // of data storedin this asset. TM_TT_PROP__ASSET__OBJECT, // subobject(*) // Thumbnail image associated with asset TM_TT_PROP__ASSET__THUMBNAIL, // subobject(TM_TT_TYPE__ASSET_THUMBNAIL)
}; The most important part here is TM_TT_PROP__ASSET__OBJECT . This is the actual object that the asset contains. For an Entity asset, this will be an object of type TM_TT_TYPE__ENTITY , etc. So the Asset object is just a wrapper that adds some metadata to the actual data object (found in TM_TT_PROP__ASSET__OBJECT ). This is where our new TM_TT_TYPE__MY_ASSET will be found. Truth types that are used as assets need to define an extension . This be shown in the Asset Browser. For example, entities have the extension "entity", so an entity named world is shown in the Asset Browser as world.entity. The extension is also used when the project is saved to disk, but in this case it will automatically be prefixed with tm_. So if you look at the project on disk, world.entity will be saved as world.tm_entity. The reason for this is to be able to easily tell The Machinery files from other disk files. We set the extension by adding a Truth aspect of type TM_TT_ASPECT__FILE_EXTENSION to our type Here's the full code for creating the type and registering the extension: static void create_truth_types(struct tm_the_truth_o *tt) { // we have properties this is why the last arguments are "0, 0" const tm_tt_type_t type = tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_ASSET, 0, 0); tm_tt_set_aspect(tt, type, tm_tt_assets_file_extension_aspect_i, "my_asset");
}

