To show an Import button in the Properties View, we need to customize the Properties View UI of our type. We can do this by adding a TM_TT_ASPECT__PROPERTIES to the Truth type. The TM_TT_ASPECT__PROPERTIES is implemented with a tm_properties_aspect_i struct. This struct has a lot of field that can be used to customize various parts of the Properties View (for more information on them, check out the documentation ). For our purposes, we are interested in the custom_ui() field that lets us use a custom callback for drawing the type in the Properties View. custom_ui() wants a function pointer of the type float (*custom_ui)(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, tm_tt_id_t object). Let us quickly go over this: Argument Data Type Description args tm_properties_ui_args_t A struct with information from the Properties View that can be used in drawing the UI. For example, this has the ui instance as well as the uistyle which you will need in any tm_ui_api calls. For more information check the documentation . item_rect tm_rect_t The rect in the Properties View UI where the item should be drawn. Note that the height in this struct (item_rect.h) is the height of a standard property field. You can use more or less height to draw your type as long as you return the right y value (see below). object tm_tt_id_t The ID of the Truth object that the Properties View wants to draw. Return value Description float Returns the y coordinate where the next item in the Propertiew View should be drawn. This should be item_rect.y + however much vertical space your controls are using. To implement the custom_ui() function we can make use of the functions for drawing property UIs found in tm_properties_view_api , or we can draw UI directly using tm_ui_api . Once we've implemented custom_ui() we need a instance of tm_properties_aspect_i to register. This instance must have global lifetime so it doesn't get destroyed: //.. other code
static float properties__custom_ui(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, tm_tt_id_t object) { return item_rect.y;
}
static tm_properties_aspect_i properties_aspect = { .custom_ui = properties__custom_ui,
};
// .. other code Now we can register this aspect with tm_truth_api: //.. other code static void create_truth_types(struct tm_the_truth_o *tt) { static tm_properties_aspect_i properties_aspect = { .custom_ui = properties__custom_ui, }; tm_tt_set_aspect(tt, type, tm_properties_aspect_i, &properties_aspect);
}
//... the other code In the editor, the change is imminently visible. The UI is gone, because it is now using our custom_ui() function, but our custom_ui() function isn't drawing anything. Let's add the Imported Path property back to the UI. We can look at the properties view API for a suitable function to draw this property (if we can't find anything we may have to write a custom drawer ourselves). We could use tm_properties_view_api->ui_property_default(). This would use the default editor based on the property type. For a STRING property, this is just a text edit field, the same thing that we saw before implementing our custom_ui() function. (If we don't have a custom UI, the default UI for each property will be used.) We chould also use tm_properties_view_api->ui_string(). This is just another way of drawing the default STRING UI. But for our purposes, tm_properties_view_api->ui_open_path() is better. This is a property UI specifically for file system path. It will draw a button, and if you click the button a system file dialog is shown that let's you pick a path. Note that in order to use tm_properties_view_api we need to load it in our tm_load_plugin() function: static struct tm_properties_view_api *tm_properties_view_api;
