} Now we can call ui_open_path() . Let's start by looking at its signature : float (*ui_open_path)(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, const char *name, const char *tooltip, tm_tt_id_t object, uint32_t property, const char *extensions, const char *description, bool *picked) Argument Data Type Description args tm_properties_ui_args_t For this argument, we should pass along the args pointer we got in our custom_ui() function. item_rect tm_rect_t The rect where we want the UI of the control to be drawn (including the label). name const char* The label that the Properties View UI will display in front of the button. tooltip const char* Tooltip that will be shown if the mouse is hovered over the label. object tm_tt_id_t The Truth object that holds the path STRING that should be edited. property uint32_t The index of the STRING property that should be edited. extension const char* List of file extensions that the open file dialog should show (separated by space). description const char* Description of the file to open shown in the open file dialog. picked bool* Optional out pointer that is set to true if a new file was picked in the file dialog. Return value Description float The y coordinate where the next property should be drawn. We can now implement the function: bool picked = false;
item_rect.y = tm_properties_view_api->ui_open_path( args, item_rect, TM_LOCALIZE_LATER("Import Path"), TM_LOCALIZE_LATER("Path that the text file was imported from."), object, TM_TT_PROP__MY_ASSET__FILE, "txt", "text files", &picked);
if (picked) {
} Note that we are using the property index TM_TT_PROP__MY_ASSET__FILE that we defined in the header file hearlier: #pragma once
