{ TM_TT_PROP__MY_ASSET__FILE, TM_TT_PROP__MY_ASSET__DATA,
}; We can now test this in the engine. We see an Import Path label with a button and when we click it, we get asked to import a file. Next, we want to make sure that when the user picks a file using this method, we load the file and store it in our DATA buffer. To load files we can use the tm_os_api which gives us access to OS functionality. tm_os_api has a lot of sub-APIs for different purposes (files, memory, threading, etc). In our case, what we need is tm_os_api->file_io which provides access to File I/O functionality: //other includes
#include <foundation/os.h>
#include <foundation/buffer.h>
//.. other code
static float properties__custom_ui(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, tm_tt_id_t object) { return item_rect.y;
}
static tm_properties_aspect_i properties_aspect = { .custom_ui = properties__custom_ui,
}; When a new file is picked in the UI (checked with the picked variable) we get the file path from The Truth, read the file data and store it in The Truth. To manage buffers, we make use of the interface in buffers.h. Creating a buffer is a three step process: Allocating the memory for the buffer (based on the file size). Filling the buffer with content (in this case, from the text file). Adding the buffer to the tm_buffers_i object. Once we have created the buffer, we need to set the BUFFER data item in the Truth object to this buffer. Changing a value in The Truth is another three step process: Ask the Truth for a write pointer to the object using write(). Set the buffer for the write pointer using set_buffer(). Commit the changes to the Truth using commit(). We need this somewhat complicated procedure because objects in The Truth are immutable by default. This ensures that The Truth can be used from multiple threads simulatenously. When you change a Truth object using the write()/commit() protocol, the changes are applied atomically. I.e., other threads will either see the old Truth object or the new one, never a half-old, half-new object. If you want the change to go into the undo stack so that you can revert it with Edit  Undo , you need some additional steps: Create an undo scope for the action using create_undo_scope(). Pass that undo scope into commit(). Register the undo scope with the application's undo stack (found in args->undo_stack). To simplify this example, we've skipped that step and instead we use TM_TT_NO_UNDO_SCOPE for the commit() action which means the action will not be undoable.

