static float properties__custom_ui(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, tm_tt_id_t object)
{ tm_the_truth_o *tt = args->tt; bool picked = false; item_rect.y = tm_properties_view_api->ui_open_path(args, item_rect, TM_LOCALIZE_LATER("Import Path"), TM_LOCALIZE_LATER("Path that the text file was imported from."), object, TM_TT_PROP__MY_ASSET__FILE, "txt", "text files", &picked); if (picked) { const char *file = tm_the_truth_api->get_string(tt, tm_tt_read(tt, object), TM_TT_PROP__MY_ASSET__FILE); tm_file_stat_t stat = tm_os_api->file_system->stat(file); tm_buffers_i *buffers = tm_the_truth_api->buffers(tt); void *buffer = buffers->allocate(buffers->inst, stat.size, false); tm_file_o f = tm_os_api->file_io->open_input(file); tm_os_api->file_io->read(f, buffer, stat.size); tm_os_api->file_io->close(f); const uint32_t buffer_id = buffers->add(buffers->inst, buffer, stat.size, 0); tm_the_truth_object_o *asset_obj = tm_the_truth_api->write(tt, object); tm_the_truth_api->set_buffer(tt, asset_obj, TM_TT_PROP__MY_ASSET__DATA, buffer_id); tm_the_truth_api->commit(tt, asset_obj, TM_TT_NO_UNDO_SCOPE); } return item_rect.y;
}
