{ static tm_the_truth_property_definition_t my_asset_properties[] = { {"import_path", TM_THE_TRUTH_PROPERTY_TYPE_STRING}, {"data", TM_THE_TRUTH_PROPERTY_TYPE_BUFFER}, }; const tm_tt_type_t type = tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_ASSET, my_asset_properties, TM_ARRAY_COUNT(my_asset_properties)); tm_tt_set_aspect(tt, type, tm_tt_assets_file_extension_aspect_i, "txt"); static tm_properties_aspect_i properties_aspect = { .custom_ui = properties__custom_ui, }; tm_tt_set_aspect(tt, type, tm_properties_aspect_i, &properties_aspect);
} // -- asset browser regsiter interface
