{ const tm_tt_type_t type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__MY_ASSET); return tm_the_truth_api->create_object_of_type(tt, type, undo_scope);
}
static tm_asset_browser_create_asset_i asset_browser_create_my_asset = { .menu_name = TM_LOCALIZE_LATER("New Text File"), .asset_name = TM_LOCALIZE_LATER("New Text File"), .create = asset_browser_create,
};
// -- load plugin
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_the_truth_api = tm_get_api(reg, tm_the_truth_api); tm_properties_view_api = tm_get_api(reg, tm_properties_view_api); tm_os_api = tm_get_api(reg, tm_os_api); tm_add_or_remove_implementation(reg, load, tm_the_truth_create_types_i, create_truth_types); tm_add_or_remove_implementation(reg, load, tm_asset_browser_create_asset_i, &asset_browser_create_my_asset);
