In this part, we will add the ability to import a text file into the Engine. To implement an importer, we need the following APIs: Name header file Description tm_asset_io_api foundation/asset_io.h This API has the importer interface. tm_temp_allocator_api foundation/temp_allocator.h We will use this to allocate temporary memory. tm_allocator_api foundation/allocator.h We will use this for permanent memory allocations. tm_allocator_api supports a number of different allocators, for example the system allocator. We need this one later when we rewrite our reimport. tm_path_api foundation/path.h Used for splitting and joining file system paths. tm_api_registry_api foundation/api_registry.h We use this to get access to APIs from the API registry. tm_task_system_api foundation/task_system.h Allows us to spawm tasks We include these header files and retrieve the APis from the API registry. Note: tm_api_registry_api can be retrived from the reg parameter in the tm_load_plugin function. tm_global_api_registry = reg; The Machinery has a generic interface for asset importers. It requires a bunch of functions to be able to work as intended. The struct we need to implement is called tm_asset_io_i . It requires us to set the following members: Member Description enabled() Should return true if the importer is active. can_import() Optional. Should return true for the file extensions that can be imported by this interface. can_reimport() Optional. Should return true for Truth assets that can be reimported. importer_extensions_string() Optional. Extensions that can be imported by this interface. importer_description_string() Optional. Descriptions for the extensions in importer_extensions_string(). import_asset() Implements the import. Since imports can be slow, they are typically implemented as background tasks and this function should return the ID of the background task from tm_task_system_api . All these members expect a function pointer. Therefore, we need to provide the functionality. To implement the first functions, we need to do the following steps: //... other includes
#include <foundation/carray_print.inl>
#include <foundation/string.inl>
#include <foundation/localizer.h>
//... other code
static bool asset_io__enabled(struct tm_asset_io_o *inst) { return true; }
static bool asset_io__can_import(struct tm_asset_io_o *inst, const char *extension) { return tm_strcmp_ignore_case(extension, "txt") == 0;
}
static bool asset_io__can_reimport(struct tm_asset_io_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset) { const tm_tt_id_t object = tm_the_truth_api->get_subobject( tt, tm_tt_read(tt, asset), TM_TT_PROP__ASSET__OBJECT); return object.type == tm_the_truth_api ->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__MY_ASSET) .u64;
}
static void asset_io__importer_extensions_string(struct tm_asset_io_o *inst, char **output, struct tm_temp_allocator_i *ta, const char *separator) { tm_carray_temp_printf(output, ta, "txt");
}
static void
asset_io__importer_description_string(struct tm_asset_io_o *inst, char **output, struct tm_temp_allocator_i *ta, const char *separator) { tm_carray_temp_printf(output, ta, ".txt");
} Let us go through them: enabled() returns true because we want the importer to work. asset_io__can_import() compares the extension with the one we want to support. Note : string.inl which we need to include for tm_strcmp_ignore_case() uses the tm_localizer_api for some of its functionality, that's why we need it. asset_io__can_reimport() checks if the object type matches our type. TM_TT_PROP__ASSET__OBJECT is the property of the TM_TT_TYPE__ASSET type which holds the object associated with the asset. The last two functions append .txt to the file extensions and descriptions. Note that the argument output is a carray . We can use tm_carray_temp_printf() to append to that array. Note : carray_print.h requires tm_sprintf_api`. Therefore, we need to include the right header here.

