To run the import as a background task we need to queue a task using the tm_task_manager_api from our asset_io__import_asset() function. Task functions take a single void *userdata argument. Since we typically want to pass more than one thing to the task, we put everything the task needs in a struct and pass a pointer to that struct as the userdata. The task function casts this void * to the desired type and can then make use of the data. The task needs to know the location of the file that is to be imported. It also needs access to some semi-global objects, such as the Truth that the file should be imported to, and an allocator to use for memory allocations. The struct could look like this: struct task__import_txt { uint64_t bytes; struct tm_asset_io_import args; char file[8];
}; The tm_asset_io_import field will used be copied from the parameter passed to asset_io__import_asset() to the struct. The function itself looks like this: static uint64_t asset_io__import_asset(struct tm_asset_io_o *inst, const char *file, const struct tm_asset_io_import *args) { const uint64_t bytes = sizeof(struct task__import_txt) + strlen(file); struct task__import_txt *task = tm_alloc(args->allocator, bytes); *task = (struct task__import_txt){ .bytes = bytes, .args = *args, }; strcpy(task->file, file); return task_system->run_task(task__import_txt, task, "Import Text File", tm_tt_task_owner(args->tt), false);
} Important : The task is the memory owner and needs to clean it up at the end of the execution! The line task_system->run_task(task__import_txt, task, "Import Text File"); queues the task task import_txt() , with the data task, and returns its id. The id can be used to query for when the background task has completed. Info: For more information on the task system check the documentation .

