The import task should import the data and clean up afterwards. The function signature is: static void task__import_txt(void *data, uint64_t task_id) {} We need to cast ptr to our previously defined data type task__import_txt. The task id can be used by the task callback function to provide task progress updates. In this example, we do not use it. For more information on how to update the status of a task so that it is shown in the editor, see the documentation . To implement the import we retrieve the data passed in the struct and then implement the import as in the previous chapter. The reimport works the same as the import, except we add the buffer to an existing object instead of creating a new one: static void task__import_txt(void *data, uint64_t task_id) { struct task__import_txt *task = (struct task__import_txt *)data; const struct tm_asset_io_import *args = &task->args; const char *txt_file = task->file; tm_the_truth_o *tt = args->tt;
} Another thing we should consider is error checking: Does the file exist? Can we read the expected number of bytes from the file? Since we are running as a background task, we will report any errors through the logging API: tm_logger_api . Errors reported that way will appear in the Console tab of the UI: static void task__import_txt(void *data, uint64_t task_id) { struct task__import_txt *task = (struct task__import_txt *)data; const struct tm_asset_io_import *args = &task->args; const char *txt_file = task->file; tm_the_truth_o *tt = args->tt; tm_file_stat_t stat = tm_os_api->file_system->stat(txt_file); if (stat.exists) { } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not find %s \n", txt_file); } tm_free(args->allocator, task, task->bytes);
} Now we combine all the knowledge from this chapter and the previous chapter. We need to create a new asset via code for the import, and for the reimport, we need to update an existing file. Before we do all of this, let us first read the file and create the buffer. static void task__import_txt(void *data, uint64_t task_id) { struct task__import_txt *task = (struct task__import_txt *)data; const struct tm_asset_io_import *args = &task->args; const char *txt_file = task->file; tm_the_truth_o *tt = args->tt; tm_file_stat_t stat = tm_os_api->file_system->stat(txt_file); if (stat.exists) { tm_buffers_i *buffers = tm_the_truth_api->buffers(tt); void *buffer = buffers->allocate(buffers->inst, stat.size, false); tm_file_o f = tm_os_api->file_io->open_input(txt_file); const int64_t read = tm_os_api->file_io->read(f, buffer, stat.size); tm_os_api->file_io->close(f); } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not find %s \n", txt_file); } tm_free(args->allocator, task, task->bytes);
} After this, we should ensure that the file size matches the size of the read data. static void task__import_txt(void *data, uint64_t task_id) { struct task__import_txt *task = (struct task__import_txt *)data; const struct tm_asset_io_import *args = &task->args; const char *txt_file = task->file; tm_the_truth_o *tt = args->tt; tm_file_stat_t stat = tm_os_api->file_system->stat(txt_file); if (stat.exists) { tm_buffers_i *buffers = tm_the_truth_api->buffers(tt); void *buffer = buffers->allocate(buffers->inst, stat.size, false); tm_file_o f = tm_os_api->file_io->open_input(txt_file); const int64_t read = tm_os_api->file_io->read(f, buffer, stat.size); tm_os_api->file_io->close(f); if (read == (int64_t)stat.size) { } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not read %s\n", txt_file); } } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not find %s \n", txt_file); } tm_free(args->allocator, task, task->bytes);
} With this out of the way, we can use our knowledge from the last part. How to add an asset via code. The first step was to create the new object and add the data to it. const uint32_t buffer_id = buffers->add(buffers->inst, buffer, stat.size, 0);
const tm_tt_type_t plugin_asset_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__MY_ASSET);
const tm_tt_id_t asset_id = tm_the_truth_api->create_object_of_type( tt, plugin_asset_type, TM_TT_NO_UNDO_SCOPE);
tm_the_truth_object_o *asset_obj = tm_the_truth_api->write(tt, asset_id);
tm_the_truth_api->set_buffer(tt, asset_obj, TM_TT_PROP__MY_ASSET__DATA, buffer_id);
tm_the_truth_api->set_string(tt, asset_obj, TM_TT_PROP__MY_ASSET__FILE, txt_file);
tm_the_truth_api->commit(tt, asset_obj, args->undo_scope); After that, we can use the tm_asset_browser_add_asset_api to add the asset to the asset browser. struct tm_asset_browser_add_asset_api *add_asset = tm_get_api(tm_global_api_registry, tm_asset_browser_add_asset_api); We are getting the API first, because we do not need it anywhere else than in this case. Then we need to extract the file name of the imported file. You can do this with the path API 's tm_path_api->base() function. Be aware this function requires a tm_str_t which you an create from a normal C string (const char*) via tm_str() . To access the underlaying C string again just call .data on the tm_str_t . tm_str_t represents strings with a char * and a size, instead of just a char *. This lets you reason about parts of a string, which you are not able to do with standard NULL-terminated strings. documentation We want to add the asset to the folder that currently open in the asset browser. We can ask the tm_asset_browser_add_asset_api what the current folder is. Then we decide if want to select the file. At the end we call tm_asset_browser_add_asset_api->add(). Note: If we wanted to, we could add asset labels to the asset and pass them as the last two arguments of the add() function instead of 0, 0. struct tm_asset_browser_add_asset_api *add_asset = tm_get_api(tm_global_api_registry, tm_asset_browser_add_asset_api); That's it for the import. Before we move on, we need to clean up! No allocation without deallocation! tm_free(args->allocator, task, task->bytes); Info: If you forget to do this, the Engine will inform you that there is a memory leak in the Console log Now let's bring it all together: static void task__import_txt(void *data, uint64_t task_id) { struct task__import_txt *task = (struct task__import_txt *)data; const struct tm_asset_io_import *args = &task->args; const char *txt_file = task->file; tm_the_truth_o *tt = args->tt; tm_file_stat_t stat = tm_os_api->file_system->stat(txt_file); if (stat.exists) { tm_buffers_i *buffers = tm_the_truth_api->buffers(tt); void *buffer = buffers->allocate(buffers->inst, stat.size, false); tm_file_o f = tm_os_api->file_io->open_input(txt_file); const int64_t read = tm_os_api->file_io->read(f, buffer, stat.size); tm_os_api->file_io->close(f); if (read == (int64_t)stat.size) { const uint32_t buffer_id = buffers->add(buffers->inst, buffer, stat.size, 0); const tm_tt_type_t plugin_asset_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__MY_ASSET); const tm_tt_id_t asset_id = tm_the_truth_api->create_object_of_type( tt, plugin_asset_type, TM_TT_NO_UNDO_SCOPE); tm_the_truth_object_o *asset_obj = tm_the_truth_api->write(tt, asset_id); tm_the_truth_api->set_buffer(tt, asset_obj, TM_TT_PROP__MY_ASSET__DATA, buffer_id); tm_the_truth_api->set_string(tt, asset_obj, TM_TT_PROP__MY_ASSET__FILE, txt_file); tm_the_truth_api->commit(tt, asset_obj, args->undo_scope); const char *asset_name = tm_path_api->base(tm_str(txt_file)).data; struct tm_asset_browser_add_asset_api *add_asset = tm_get_api(tm_global_api_registry, tm_asset_browser_add_asset_api); const tm_tt_id_t current_dir = add_asset->current_directory(add_asset->inst, args->ui); const bool should_select = args->asset_browser.u64 && tm_the_truth_api->version(tt, args->asset_browser) == args->asset_browser_version_at_start; add_asset->add(add_asset->inst, current_dir, asset_id, asset_name, args->undo_scope, should_select, args->ui, 0, 0); } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not read %s\n", txt_file); } } else { tm_logger_api->printf(TM_LOG_TYPE_INFO, "import txt:could not find %s \n", txt_file); } tm_free(args->allocator, task, task->bytes);
}

