Our implementation does not yet support reimports. Let us fix this quickly! tm_asset_io_import has a field called reimport_into of type tm_tt_id_t . When doing a regular import, the value of this field will be (tm_tt_id_t){0}. When reimporting, it will be the ID of the Truth object that we should import into. To change an existing object instead of creating a new one, we can use the function tm_the_truth_api->retarget_write(). It will make the commit() operation write the changes to an existing object instead of two the new one we just created. After comitting, we can destroy the new (temporary) object: if (args->reimport_into.u64) { tm_the_truth_api->retarget_write(tt, asset_obj, args->reimport_into); tm_the_truth_api->commit(tt, asset_obj, args->undo_scope); tm_the_truth_api->destroy_object(tt, asset_id, args->undo_scope);
} else { tm_the_truth_api->commit(tt, asset_obj, args->undo_scope); const char *asset_name = tm_path_api->base(tm_str(txt_file)).data; struct tm_asset_browser_add_asset_api *add_asset = tm_get_api(tm_global_api_registry, tm_asset_browser_add_asset_api); const tm_tt_id_t current_dir = add_asset->current_directory(add_asset->inst, args->ui); const bool should_select = args->asset_browser.u64 && tm_the_truth_api->version(tt, args->asset_browser) == args->asset_browser_version_at_start; add_asset->add(add_asset->inst, current_dir, asset_id, asset_name, args->undo_scope, should_select, args->ui, 0, 0);
} With these changes, the source code now looks as like this: static void task__import_txt(void *data, uint64_t task_id) {}

