Let us create a use case for our text file. Let us assume we wanted to make a very simple story-based game, and all our text files are the basis for our stories. This means we need to create first a story component. Note : For more details on how to create a component, follow this guide . Here we have the whole source code for the story component: // more apis
static struct tm_entity_api *tm_entity_api;
// more includes
#include <plugins/entity/entity.h>
#include <plugins/the_machinery_shared/component_interfaces/editor_ui_interface.h>
// more code static const char *component__category(void) { return TM_LOCALIZE("Story"); } static tm_ci_editor_ui_i *editor_aspect = &(tm_ci_editor_ui_i){.category = component__category}; {{insert_code(env.TM_BOOK_CODE_SNIPPETS/custom_assets/drag_drop/txt.c,create_truth_types,off)}} struct tm_component_manager_o { tm_entity_context_o *ctx; tm_allocator_i allocator;
};
static bool component__load_asset(tm_component_manager_o *man, struct tm_entity_commands_o *commands, tm_entity_t e, void *c_vp, const tm_the_truth_o *tt, tm_tt_id_t asset) { struct tm_story_component_t *c = c_vp; const tm_the_truth_object_o *asset_r = tm_tt_read(tt, asset); tm_tt_id_t id = tm_the_truth_api->get_reference( tt, asset_r, TM_TT_PROP__STORY_COMPONENT__ASSET); if (id.u64) { tm_tt_buffer_t buffer = tm_the_truth_api->get_buffer( tt, tm_tt_read(tt, id), TM_TT_PROP__MY_ASSET__DATA); c->text = tm_alloc(&man->allocator, buffer.size); c->size = buffer.size; memcpy(c->text, buffer.data, buffer.size); } return true;
}
static void component__remove(tm_component_manager_o *manager, struct tm_entity_commands_o *commands, tm_entity_t e, void *data) { tm_story_component_t *sc = (tm_story_component_t *)data; tm_free(&manager->allocator, sc->text, sc->size);
} static void component__destroy(tm_component_manager_o *manager) { // Free the actual manager struct and the allocator used to allocate it. tm_entity_context_o *ctx = manager->ctx; tm_allocator_i allocator = manager->allocator; tm_free(&allocator, manager, sizeof(tm_component_manager_o)); tm_entity_api->destroy_child_allocator(ctx, &allocator);
}
static void component__create(struct tm_entity_context_o *ctx) { // Allocate a new manager for this component type (freed in // component__destroy). tm_allocator_i allocator; tm_entity_api->create_child_allocator(ctx, TM_TT_TYPE__STORY_COMPONENT, &allocator); tm_component_manager_o *story_manager = tm_alloc(&allocator, sizeof(tm_component_manager_o)); *story_manager = (tm_component_manager_o){.ctx = ctx, .allocator = allocator}; tm_component_i component = {.name = TM_TT_TYPE__STORY_COMPONENT, .bytes = sizeof(struct tm_story_component_t), .load_asset = component__load_asset, .destroy = component__destroy, .remove = component__remove, .manager = (tm_component_manager_o *)story_manager}; tm_entity_api->register_component(ctx, &component);
}; // -- load plugin
TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load) { tm_the_truth_api = tm_get_api(reg, tm_the_truth_api); tm_properties_view_api = tm_get_api(reg, tm_properties_view_api); tm_os_api = tm_get_api(reg, tm_os_api); tm_path_api = tm_get_api(reg, tm_path_api); tm_temp_allocator_api = tm_get_api(reg, tm_temp_allocator_api); tm_allocator_api = tm_get_api(reg, tm_allocator_api); tm_logger_api = tm_get_api(reg, tm_logger_api); tm_localizer_api = tm_get_api(reg, tm_localizer_api); tm_asset_io_api = tm_get_api(reg, tm_asset_io_api); task_system = tm_get_api(reg, tm_task_system_api); tm_sprintf_api = tm_get_api(reg, tm_sprintf_api); tm_entity_api = tm_get_api(reg, tm_entity_api); tm_scene_common_api = tm_get_api(reg, tm_scene_common_api); tm_global_api_registry = reg; if (load) tm_asset_io_api->add_asset_io(&txt_asset_io); else tm_asset_io_api->remove_asset_io(&txt_asset_io); tm_add_or_remove_implementation(reg, load, tm_entity_create_component_i, component__create); tm_add_or_remove_implementation(reg, load, tm_the_truth_create_types_i, create_truth_types); tm_add_or_remove_implementation(reg, load, tm_asset_browser_create_asset_i, &asset_browser_create_my_asset);
} First, we create our component, and we need a way to guarantee that our truth data exists during runtime as well. Therefore, we use the Entity Manager to allocate our Story data and store just a pointer and its size to the allocated data in the Manager. struct tm_component_manager_o { tm_entity_context_o *ctx; tm_allocator_i allocator;
};
static void component__create(struct tm_entity_context_o *ctx) { // Allocate a new manager for this component type (freed in // component__destroy). tm_allocator_i allocator; tm_entity_api->create_child_allocator(ctx, TM_TT_TYPE__STORY_COMPONENT, &allocator); tm_component_manager_o *story_manager = tm_alloc(&allocator, sizeof(tm_component_manager_o)); *story_manager = (tm_component_manager_o){.ctx = ctx, .allocator = allocator}; tm_component_i component = {.name = TM_TT_TYPE__STORY_COMPONENT, .bytes = sizeof(struct tm_story_component_t), .load_asset = component__load_asset, .destroy = component__destroy, .remove = component__remove, .manager = (tm_component_manager_o *)story_manager}; tm_entity_api->register_component(ctx, &component);
}; The most important function here is the component__load_asset function, in which we translate the Truth Representation into an ECS representation. We load the text buffer, allocate it with the Manager, and store a pointer in our component. With this, we could create a reference-counted system in which multiple components point to the same story data, and only when the last component goes we deallocate this. Another alternative would be to avoid loading when we create the component, and the story is already allocated. static bool component__load_asset(tm_component_manager_o *man, struct tm_entity_commands_o *commands, tm_entity_t e, void *c_vp, const tm_the_truth_o *tt, tm_tt_id_t asset) { struct tm_story_component_t *c = c_vp; const tm_the_truth_object_o *asset_r = tm_tt_read(tt, asset); tm_tt_id_t id = tm_the_truth_api->get_reference( tt, asset_r, TM_TT_PROP__STORY_COMPONENT__ASSET); if (id.u64) { tm_tt_buffer_t buffer = tm_the_truth_api->get_buffer( tt, tm_tt_read(tt, id), TM_TT_PROP__MY_ASSET__DATA); c->text = tm_alloc(&man->allocator, buffer.size); c->size = buffer.size; memcpy(c->text, buffer.data, buffer.size); } return true;
} When the Entity context gets destroyed, we need to clean up and destroy our Manager. Important that we call call_remove_on_all_entities to make sure all instances of the component are gone. static void component__remove(tm_component_manager_o *manager, struct tm_entity_commands_o *commands, tm_entity_t e, void *data) { tm_story_component_t *sc = (tm_story_component_t *)data; tm_free(&manager->allocator, sc->text, sc->size);
} static void component__destroy(tm_component_manager_o *manager) { // Free the actual manager struct and the allocator used to allocate it. tm_entity_context_o *ctx = manager->ctx; tm_allocator_i allocator = manager->allocator; tm_free(&allocator, manager, sizeof(tm_component_manager_o)); tm_entity_api->destroy_child_allocator(ctx, &allocator);
} Custom UI This part is optional! , see next part where we use the TM_TT_PROP_ASPECT__PROPERTIES__ASSET_PICKER. We also can to provide a custom UI for our reference to the asset! When we define our Truth type we tell the system that it should be a reference only of type TM_TT_TYPE_HASH__TXT_ASSET. tm_the_truth_property_definition_t story_component_properties[] = { [TM_TT_PROP__STORY_COMPONENT__ASSET] = { "story_asset", .type = TM_THE_TRUTH_PROPERTY_TYPE_REFERENCE, .type_hash = TM_TT_TYPE_HASH__MY_ASSET}}; This makes sure that in the Editor the user cannot store any other Truth type in this property. The Truth will check for it We need to add the TM_TT_ASPECT__PROPERTIES aspect to our type to make sure it has a custom UI. static tm_properties_aspect_i properties_component_aspect = { .custom_ui = properties__component_custom_ui,
}; const tm_tt_type_t story_component_type = tm_the_truth_api->create_object_type( tt, TM_TT_TYPE__STORY_COMPONENT, story_component_properties, TM_ARRAY_COUNT(story_component_properties));
tm_tt_set_aspect(tt, story_component_type, tm_ci_editor_ui_i, editor_aspect);
tm_tt_set_aspect(tt, story_component_type, tm_properties_aspect_i, &properties_component_aspect); And than we need to define our custom UI: static float
properties__component_custom_ui(struct tm_properties_ui_args_t *args, tm_rect_t item_rect, tm_tt_id_t object) { TM_INIT_TEMP_ALLOCATOR(ta); tm_tt_type_t asset_type = tm_the_truth_api->object_type_from_name_hash( args->tt, TM_TT_TYPE_HASH__ASSET); tm_tt_id_t *ids = tm_the_truth_api->all_objects_of_type( args->tt, tm_the_truth_api->object_type_from_name_hash(args->tt, TM_TT_TYPE_HASH__MY_ASSET), ta); tm_tt_id_t *items = 0; const char **names = 0; tm_carray_temp_push(names, "Select", ta); tm_carray_temp_push(items, (tm_tt_id_t){0}, ta); for (uint32_t i = 0; i < tm_carray_size(ids); ++i) { tm_tt_id_t owner = tm_the_truth_api->owner(args->tt, ids[i]); if (tm_tt_type(owner).u64 == asset_type.u64) { tm_carray_temp_push( names, tm_the_truth_api->get_string(args->tt, tm_tt_read(args->tt, owner), TM_TT_PROP__ASSET__NAME), ta); tm_carray_temp_push(items, ids[i], ta); } } item_rect.y = tm_properties_view_api->ui_reference_popup_picker( args, item_rect, "Asset", NULL, object, TM_TT_PROP__STORY_COMPONENT__ASSET, names, items, (uint32_t)tm_carray_size(items)); TM_SHUTDOWN_TEMP_ALLOCATOR(ta); return item_rect.y;
} In there we get all objects of type TM_TT_TYPE_HASH__TXT_ASSET we know that this type can only exist as a sub object of the Asset Truth Type. The type can only be created a part of the asset at this point! This information is important because we need a name for our asset and therefore we just iterate over all our TXT Assets and check if they are owned by a Truth Asset type. If yes we get the name from it and store it in a names array. At the end we add all the IDs of the objects in a array so the user can select them in the drop down menu of the tm_properties_view_api.ui_reference_popup_picker() .

