Finally, we can do what we came here to do: Make our Asset drag and droppable! We make use of the TM_TT_ASPECT__ASSET_SCENE! We define the aspect as described above: #include <plugins/the_machinery_shared/asset_aspects.h>
tm_asset_scene_api scene_api = { .droppable = droppable, .create_entity = create_entity,
}; In the Create Truth Type function you need to add the aspect TM_TT_ASPECT__ASSET_SCENE: static void create_truth_types(struct tm_the_truth_o *tt) { static tm_the_truth_property_definition_t my_asset_properties[] = { {"import_path", TM_THE_TRUTH_PROPERTY_TYPE_STRING}, {"data", TM_THE_TRUTH_PROPERTY_TYPE_BUFFER}, }; const tm_tt_type_t type = tm_the_truth_api->create_object_type( tt, TM_TT_TYPE__MY_ASSET, my_asset_properties, TM_ARRAY_COUNT(my_asset_properties)); tm_tt_set_aspect(tt, type, tm_tt_assets_file_extension_aspect_i, "txt"); static tm_properties_aspect_i properties_aspect = { .custom_ui = properties__custom_ui, }; tm_tt_set_aspect(tt, type, tm_properties_aspect_i, &properties_aspect); tm_the_truth_property_definition_t story_component_properties[] = { [TM_TT_PROP__STORY_COMPONENT__ASSET] = { "story_asset", .type = TM_THE_TRUTH_PROPERTY_TYPE_REFERENCE, .type_hash = TM_TT_TYPE_HASH__MY_ASSET}};
}
//..
} Than, we provide a droppable() function: bool droppable(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset) { return true;
} After this, the more important function comes: #include <plugins/entity/transform_component.h>
#include <plugins/the_machinery_shared/scene_common.h>
// ... more code
tm_tt_id_t create_entity(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset, const char *name, const tm_transform_t *local_transform, tm_tt_id_t parent_entity, tm_tt_id_t asset_root, struct tm_undo_stack_i *undo_stack, tm_tt_undo_scope_t parent_undo_scope) { const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope( tt, TM_LOCALIZE("Create Entity From Creation Graph")); const tm_tt_type_t entity_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__ENTITY); const tm_tt_id_t entity = tm_the_truth_api->create_object_of_type(tt, entity_type, undo_scope); tm_the_truth_object_o *entity_w = tm_the_truth_api->write(tt, entity); tm_the_truth_api->set_string(tt, entity_w, TM_TT_PROP__ENTITY__NAME, name); // add transform: { const tm_tt_type_t transform_component_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__TRANSFORM_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type( tt, transform_component_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } // add story: { tm_tt_type_t asset_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__STORY_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type(tt, asset_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->set_reference(tt, component_w, TM_TT_PROP__STORY_COMPONENT__ASSET, asset); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } tm_the_truth_api->commit(tt, entity_w, undo_scope); tm_scene_common_api->place_entity(tt, entity, local_transform, parent_entity, undo_scope); undo_stack->add(undo_stack->inst, tt, undo_scope); return entity;
} First, we create an entity: tm_tt_id_t create_entity(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset, const char *name, const tm_transform_t *local_transform, tm_tt_id_t parent_entity, tm_tt_id_t asset_root, struct tm_undo_stack_i *undo_stack, tm_tt_undo_scope_t parent_undo_scope) { const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope( tt, TM_LOCALIZE("Create Entity From Creation Graph")); const tm_tt_type_t entity_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__ENTITY); const tm_tt_id_t entity = tm_the_truth_api->create_object_of_type(tt, entity_type, undo_scope); tm_the_truth_object_o *entity_w = tm_the_truth_api->write(tt, entity); tm_the_truth_api->set_string(tt, entity_w, TM_TT_PROP__ENTITY__NAME, name);
//...
} Suppose it needs a transform. If not, we don't! In this case, we add the transform to the entity, just to make a point: tm_tt_id_t create_entity(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset, const char *name, const tm_transform_t *local_transform, tm_tt_id_t parent_entity, tm_tt_id_t asset_root, struct tm_undo_stack_i *undo_stack, tm_tt_undo_scope_t parent_undo_scope) { const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope( tt, TM_LOCALIZE("Create Entity From Creation Graph")); const tm_tt_type_t entity_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__ENTITY); const tm_tt_id_t entity = tm_the_truth_api->create_object_of_type(tt, entity_type, undo_scope); tm_the_truth_object_o *entity_w = tm_the_truth_api->write(tt, entity); tm_the_truth_api->set_string(tt, entity_w, TM_TT_PROP__ENTITY__NAME, name); // add transform: { const tm_tt_type_t transform_component_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__TRANSFORM_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type( tt, transform_component_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } // ...
} Then, we add the story component to the entity we follow the same steps as before. tm_tt_id_t create_entity(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset, const char *name, const tm_transform_t *local_transform, tm_tt_id_t parent_entity, tm_tt_id_t asset_root, struct tm_undo_stack_i *undo_stack, tm_tt_undo_scope_t parent_undo_scope) { const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope( tt, TM_LOCALIZE("Create Entity From Creation Graph")); const tm_tt_type_t entity_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__ENTITY); const tm_tt_id_t entity = tm_the_truth_api->create_object_of_type(tt, entity_type, undo_scope); tm_the_truth_object_o *entity_w = tm_the_truth_api->write(tt, entity); tm_the_truth_api->set_string(tt, entity_w, TM_TT_PROP__ENTITY__NAME, name); // add transform: { const tm_tt_type_t transform_component_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__TRANSFORM_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type( tt, transform_component_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } // add story: { tm_tt_type_t asset_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__STORY_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type(tt, asset_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->set_reference(tt, component_w, TM_TT_PROP__STORY_COMPONENT__ASSET, asset); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); }
} After all this, we can commit our changes to the Truth. After this we could place it in the scene with the tm_scene_common_api.place_entity() . This step is not needed but is nice to do! Do not forget to add the undo scope to make sure we can undo our action and return the created entity! tm_tt_id_t create_entity(struct tm_asset_scene_o *inst, struct tm_the_truth_o *tt, tm_tt_id_t asset, const char *name, const tm_transform_t *local_transform, tm_tt_id_t parent_entity, tm_tt_id_t asset_root, struct tm_undo_stack_i *undo_stack, tm_tt_undo_scope_t parent_undo_scope) { const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope( tt, TM_LOCALIZE("Create Entity From Creation Graph")); const tm_tt_type_t entity_type = tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__ENTITY); const tm_tt_id_t entity = tm_the_truth_api->create_object_of_type(tt, entity_type, undo_scope); tm_the_truth_object_o *entity_w = tm_the_truth_api->write(tt, entity); tm_the_truth_api->set_string(tt, entity_w, TM_TT_PROP__ENTITY__NAME, name); // add transform: { const tm_tt_type_t transform_component_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__TRANSFORM_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type( tt, transform_component_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } // add story: { tm_tt_type_t asset_type = tm_the_truth_api->object_type_from_name_hash( tt, TM_TT_TYPE_HASH__STORY_COMPONENT); const tm_tt_id_t component = tm_the_truth_api->create_object_of_type(tt, asset_type, undo_scope); tm_the_truth_object_o *component_w = tm_the_truth_api->write(tt, component); tm_the_truth_api->set_reference(tt, component_w, TM_TT_PROP__STORY_COMPONENT__ASSET, asset); tm_the_truth_api->add_to_subobject_set( tt, entity_w, TM_TT_PROP__ENTITY__COMPONENTS, &component_w, 1); tm_the_truth_api->commit(tt, component_w, undo_scope); } tm_the_truth_api->commit(tt, entity_w, undo_scope); tm_scene_common_api->place_entity(tt, entity, local_transform, parent_entity, undo_scope); undo_stack->add(undo_stack->inst, tt, undo_scope); return entity;
} Now we have added the ability to add this to our asset! Note: This is all not done at run time, since we are dealing with the Truth here and not with the ECS our changes will apply first to the ECS when we simulate the game!

