The first cause of action is to create the Tab we want to open. Note: We can use the basic tab Template from the Engine: File -> New Plugin -> New Tab. In this walkthrough, we aim to have a simple tab that shows the content of our text file. The Steps of creating a tab are similar to the ones of a standard plugin: We create a new file. For example: txt_tab.c We make use of the default tab template provided by the engine: static struct tm_api_registry_api *tm_global_api_registry; static struct tm_draw2d_api *tm_draw2d_api;
static struct tm_ui_api *tm_ui_api;
