{ tm_ui_buffers_t uib = tm_ui_api->buffers(ui); tm_ui_style_t *uistyle = (tm_ui_style_t[]){*uistyle_in}; tm_draw2d_style_t *style = &(tm_draw2d_style_t){0}; tm_ui_api->to_draw_style(ui, style, uistyle); style->color = (tm_color_srgb_t){.a = 255, .r = 255}; tm_draw2d_api->fill_rect(uib.vbuffer, *uib.ibuffers, style, rect);
