Now that we have done all the boilerplate code, let us focus on the three functions that count: The create function The UI Update The Set Root function The Create Function static const char *tab__create_menu_name(void) { return "Text Tab"; } static const char *tab__title(tm_tab_o *tab, struct tm_ui_o *ui) { return "Text Tab";
} static tm_tab_vt *tab_vt; static tm_tab_i *tab__create(tm_tab_create_context_t *context, tm_ui_o *ui) { tm_allocator_i *allocator = context->allocator; uint64_t *id = context->id; tm_tab_o *tab = tm_alloc(allocator, sizeof(tm_tab_o)); *tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt *)tab_vt, .inst = (tm_tab_o *)tab, .root_id = *id, }, .allocator = allocator, }; *id += 1000000; return &tab->tm_tab_i;
} In this function, we store the allocator first. Tipp: if you wanted to create a child allocator, you could do this for your Tab. A child allocator may be very useful when doing many allocations: tm_allocator_api.create_child() . We need to initialize the tab interface so other engine parts can communicate with a generic interface to the Tab. We store a pointer to our Tab within this interface so other callers of the standard generic interface can access this instance and pass it along to the functions. After this, we allocate the Tab itself. tm_tab_o *tab = tm_alloc(allocator, sizeof(tm_tab_o));
*tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt *)tab_vt, .inst = (tm_tab_o *)tab, .root_id = *id, }, .allocator = allocator,
}; In the end, we return the pointer to the interface, so the docking system has it The Update Function static void tab__ui(tm_tab_o *tab, tm_ui_o *ui, const tm_ui_style_t *uistyle_in, tm_rect_t rect) { tm_ui_style_t *uistyle = (tm_ui_style_t[]){*uistyle_in}; if (tab->asset.u64) { TM_INIT_TEMP_ALLOCATOR(ta); tm_tt_buffer_t buffer = tm_the_truth_api->get_buffer( tab->tt, tm_tt_read(tab->tt, tab->asset), TM_TT_PROP__MY_ASSET__DATA); char *content = tm_temp_alloc(ta, buffer.size + 1); tm_strncpy_safe(content, buffer.data, buffer.size); tm_ui_text_t *text = &(tm_ui_text_t){.text = content, .rect = rect}; tm_ui_api->wrapped_text(ui, uistyle, text); TM_SHUTDOWN_TEMP_ALLOCATOR(ta); } else { rect.h = 20; tm_ui_text_t *text = &(tm_ui_text_t){.align = TM_UI_ALIGN_CENTER, .text = "Please open a .txt asset.", .rect = rect}; tm_ui_api->text(ui, uistyle, text); }
} At first, we create a copy of the UI Style. With this copy, we can do what we want since the input style is a const pointer. After this, we check if the asset is present. If not, we print a message on the Tab that the user must select a txt asset. static void tab__ui(tm_tab_o *tab, tm_ui_o *ui, const tm_ui_style_t *uistyle_in, tm_rect_t rect) { tm_ui_style_t *uistyle = (tm_ui_style_t[]){*uistyle_in}; if (tab->asset.u64) { } else { rect.h = 20; tm_ui_text_t *text = &(tm_ui_text_t){.align = TM_UI_ALIGN_CENTER, .text = "Please open a .txt asset.", .rect = rect}; tm_ui_api->text(ui, uistyle, text); }
} We need an allocator to copy the data of the buffer into a proper string. The allocator is needed since we never added a null terminator to the end of the string when we save it into the buffer. In this case, we need a temporary allocator. Since we do not want to keep the memory forever, we need to initialize a temp allocator with TM_INIT_TEMP_ALLOCATOR and provide a name. Do not forget to free the memory at the end. static void tab__ui(tm_tab_o *tab, tm_ui_o *ui, const tm_ui_style_t *uistyle_in, tm_rect_t rect) { tm_ui_style_t *uistyle = (tm_ui_style_t[]){*uistyle_in}; if (tab->asset.u64) { TM_INIT_TEMP_ALLOCATOR(ta); TM_SHUTDOWN_TEMP_ALLOCATOR(ta); } else { rect.h = 20; tm_ui_text_t *text = &(tm_ui_text_t){.align = TM_UI_ALIGN_CENTER, .text = "Please open a .txt asset.", .rect = rect}; tm_ui_api->text(ui, uistyle, text); }
} Note: If the memory is smaller than 1024 bytes, the memory is allocated to the stack. Moreover, an alternative is the frame allocator in which the memory is freed every frame. The next step is it to ask the truth for the buffer and allocate the right amount of memory. Since we want to copy the data into a null-terminated string, we should add 1 to the data size. tm_tt_buffer_t buffer = tm_the_truth_api->get_buffer( tab->tt, tm_tt_read(tab->tt, tab->asset), TM_TT_PROP__MY_ASSET__DATA);
char *content = tm_temp_alloc(ta, buffer.size + 1);
tm_strncpy_safe(content, buffer.data, buffer.size); To ensure our string is clean and filled with nulls, we use the inline string file (hence we add the foundation/string.inl to our includes). We have the tm_strncpy_safe within this header file, which fills up a string with null terminator. tm_strncpy_safe(content, buffer.data, buffer.size); The last step before we are done is actually to make the text appear on the screen. We make use of the tm_ui_api.wrapped_text() since this function will print the string in multiple lines if need be. tm_ui_text_t *text = &(tm_ui_text_t){.text = content, .rect = rect};
tm_ui_api->wrapped_text(ui, uistyle, text); The set root / root function The last function which we need is the set root function. This function allows us to set a root object of the Tab from the outside. Its code is quite straightforward: {{insert_code(env.TM_BOOK_CODE_SNIPPETS/custom_assets/open_asset/tab.c,root}} Note : The root function is also called when ever the current "main" Truth changes. This can be used to swap the truth.

