} To open an asset, we need to add another aspect to our type. It is the TM_TT_ASPECT__ASSET_OPEN aspect! This aspect requires a implementation of the tm_asset_open_aspect_i . // -- create truth type
static void create_truth_types(struct tm_the_truth_o *tt) { tm_tt_set_aspect(tt, type, tm_asset_open_aspect_i, open_i);
} We add this implementation of the tm_asset_open_aspect_i above the create_truth_types function. void open_asset(struct tm_application_o *app, struct tm_ui_o *ui, struct tm_tab_i *from_tab, tm_the_truth_o *tt, tm_tt_id_t asset, enum tm_asset_open_mode open_mode) { const tm_docking_find_tab_opt_t opt = { .from_tab = from_tab, .in_ui = ui, .exclude_pinned = true, }; const bool pin = open_mode == TM_ASSET_OPEN_MODE_CREATE_TAB_AND_PIN; tm_tab_i *tab = tm_the_machinery_api->create_or_select_tab( app, ui, TM_TXT_TAB_VT_NAME, &opt); if (pin) tm_docking_api->pin_object(tab, tt, asset); else tab->vt->set_root(tab->inst, tt, asset);
} static tm_asset_open_aspect_i *open_i = &(tm_asset_open_aspect_i){ .open = open_asset,
}; The open function gives us all the important information: The App data The UI Which Tab requested this action The current Truth the asset How we will open the Tab. At first, we define the search criteria for the create_or_select_tab of the Machinery API. In this case we want to exclude pinned tabs since the user might have a reason for why they are pinned! tm_tab_i *tab = tm_the_machinery_api->create_or_select_tab( app, ui, TM_TXT_TAB_VT_NAME, &opt); Now we can create or select a tab by calling the create_or_select_tab function. const tm_docking_find_tab_opt_t opt = { .from_tab = from_tab, .in_ui = ui, .exclude_pinned = true,
}; The last step is actually to pass some data along! In this case, we need to check if something is pinned or not! Hence we check if the open_mode is equal to pinning. If yes, we ask the docking API to pin our Tab. const bool pin = open_mode == TM_ASSET_OPEN_MODE_CREATE_TAB_AND_PIN;
if (pin) tm_docking_api->pin_object(tab, tt, asset);
else tab->vt->set_root(tab->inst, tt, asset);

