You can log custom types. This is enabled via the tm_sprintf_api . You can log all primitive types like you are used to from C but as well as the engines API types. Just keep in mind the following syntax: %p{<MY_TYPE>} and the fact that you need to provide a pointer to the correct type: type call bool TM_LOG("%p{bool}",&my_value); tm_vec2_t TM_LOG("%p{tm_vec2_t}",&my_value); tm_vec3_t TM_LOG("%p{tm_vec3_t}",&my_value); tm_vec4_t TM_LOG("%p{tm_vec4_t}",&my_value); tm_mat44_t TM_LOG("%p{tm_mat44_t}",&my_value); tm_transform_t TM_LOG("%p{tm_transform_t}",&my_value); tm_rect_t TM_LOG("%p{tm_rect_t}",&my_value); tm_str_t TM_LOG("%p{tm_str_t}",&my_value); tm_uuid_t TM_LOG("%p{tm_uuid_t}",&my_value); tm_color_srgb_t TM_LOG("%p{tm_color_srgb_t}",&my_value); tm_tt_type_t TM_LOG("%p{tm_tt_type_t}",&my_value); tm_tt_id_t TM_LOG("%p{tm_tt_id_t}",&my_value); tm_tt_undo_scope_t TM_LOG("%p{tm_tt_undo_scope_t}",&my_value); tm_strhash_t TM_LOG("%p{tm_strhash_t}",&my_value); You can register a support for your own custom type via the tm_sprintf_api.add_printer() . example: First you define a function with a signature of the type tm_sprintf_printer . int tm_sprintf_printer(char *buf, int count, tm_str_t type, tm_str_t args, const void *data); static int printer__custom_color_srgb_t(char *buf, int count, tm_str_t type, tm_str_t args, const void *data)
{ const custom_color_srgb_t *v = data; return print(buf, count, "{ .r = %d, .g = %d, .b = %d, .a = %d , .hash = %llu }", v->r, v->g, v->b, v->a, v->hash);
} After that you register it via the tm_sprintf_api to the add_printer() function. TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_sprintf_api = reg->get(TM_SPRINTF_API_NAME); if(tm_sprintf_api->add_printer){ tm_sprintf_api->add_printer("custom_color_srgb_t", printer__custom_color_srgb_t); }
}

