The code example above is great but its quite a lot of work. This is something you can change. Since Premake5 is using Lua you can just write functions to bundle your code together. For example lets say we want a base for all our projects: function base(name) project(name) language "C++" includedirs { "" }
end And than we want to make sure that our plugins (.dlls) are all the same but easy to use: function plugin(name) local sn = snake_case(name) -- function that converts a name to snake case base(name) location("build/plugins/" .. sn) kind "SharedLib" targetdir "bin/%{cfg.buildcfg}/plugins" targetname("tm_" .. sn) defines {"TM_LINKS_" .. string.upper(sn)} dependson("foundation") folder {"plugins/" .. sn} language "C++" includedirs { "" } -- A override (see above) that makes sure we have the right include dir also with the SDK dirs
end This allows us to re-write our example from above: plugin("test-plugin")
plugin("new-project") Moreover we need a utility tool? No problem we can just write a function for this: -- Project type for utility programs
function util(name) local sn = snake_case(name) base(name) location("build/" .. sn) kind "ConsoleApp" targetdir "bin/%{cfg.buildcfg}" defines { "TM_LINKS_FOUNDATION" } dependson { "foundation" } links { "foundation" } folder {"utils/" .. sn} filter { "platforms:Linux" } linkoptions {"-ldl", "-lanl", "-pthread"} filter {} -- clear filter for future calls
end This allows for the following lines of code: plugin("test-plugin")
plugin("new-project")
util("my-untility")

